import React from 'react'
import Imagen1 from '../assets/imagen1.jpg';


const Img1 = () => {
  return (
    <div className=' bg-none mx-auto object-fill h-3 '>
    <div className=' mx-auto grid '>
   <img className=' md:w-[100%] w-[100%]' src={Imagen1} alt="/" />
   </div>
   </div>
  )
}

export default Img1;
